  02> MACLEAN, Patience Elliot m on 11.06.1950 to KEARNS, Bernard John
  b 14.01.1928
  b 13.01.1925
  Patience b. at Lower Hutt and m. at Melbourne, Australia. Separated. Bernard, s/o John
  Joseph Kearns and Margaret Mary Donaghue. Address: 9 Malcolm Avenue, Christchurch.
  Patience graduated BA from Canterbury University. She toured to Australia with the
  Canterbury Student Players, with Ngaio Marsh. Whilst in Melbourne married Bernard, and
  their first daughter, Elizabeth, was born there. They returned to New Zealand in 1950.
  When the children were grown, she taught primary school for 20 years. Her interests are
  patchwork quilting (one of her commissioned works hangs in the Oncology Department of Christchurch
  Hospital, and she has participated in several exhibitions), gardening and family research.
  Bernard was a radio broadcaster.
  01> KEARNS, Elizabeth Patience m on 31.03.1971 to (1)RIDDER, Peter John
  b 24.03.1950
  Elizabeth b. at Melbourne, Australia.
  b ** ** ****
  01> KEARNS, Elizabeth Patience m on 28.10.1993 to (2)BEALE, William John
  b 24.03.1950
  b 15.06.1948
  Elizabeth m, at Denpasar, Bali, Indonesia. William, s/o Cyril Claude Beale and Rhoda Marion
  Koerbin, b. at Lower Hutt. Address: 11 Joll Street, Karori, Wellington 5.
  Elizabeth was educated at Cottesmore College, Cashmere High School and Canterbury School of Fine
  Arts and graduated BA and Diploma of Library Studies from Victoria University. She worked for 17
  years in the Victoria University Library, was Executive Assistant at the Hutt City Council, and is
  currently Administrator of the Friends of the Museum of New Zealand Te Papa Tongarewa. Her
  interests, shared by her Burmese cats Pomme and Flora, include travel, gardening, cooking,
  traditional decorative painting and trompe l'oeuil. She was Secretary of the Friends of the City
  Opera (now National Opera of Wellington) and is Membership Secretary of the Wellington Film
  Society.
  William was educated at Hutt Valley High School and graduated MSc from Victoria University. He is
  Managing Director of Fujitsu New Zealand.
  02> KEARNS, Jennifer Mary m on ** ** 1979 to SMITH, Benjamin
  b 07.07.1951
  b 20.06.1951
  Jennifer b, at Christchurch and m. at Melbourne, Australia. Benjamin, s/o Albert Smith and Betty
  Aarons, b. at Melbourne. Address: 14 Toogoods Rise, Box Hill North 3129, Vic, Australia.
  Jennifer was educated in Christchurch and gained her New Zealand Library Associates Certificate.
  She worked in several libraries before moving to Melbourne.
  Benjamin lived in Israel in 1964-74. He graduated as an engineer and now runs his own consulting
  company.
